                            <p>3</p>
                        </div>

                        <div className="cell">
                            <h3>Languages{"\n"}Learned</h3>
                            <p>6</p>
                        </div>
                    </div>*/}

                    {/*avatar*/}
                    <div className="avatar_wrapper">
                    </div>
                </div>
                <div className="icon_wrapper">
                </div>
                {/*<p>about me</p>*/}
            </div>
        </div>
    );
};

export default Home;
